import React, { useState } from "react";
import "./App.css";

function App(){  
  const [width,setWidth] = useState(window.innerWidth)

  function print(){
    console.log("print1")
    window.alert("print1 function")
  }

  const print2=()=>{
    console.log("print2")
    window.alert("print2 function")
  }
  const printMemo= memo(print)
  const printMemo2= memo(print2)

  return (
    <div className="App"> 
      {printMemo()}
      {printMemo2()}

      <h2> {width} </h2>
      <button type="button" onClick={()=>setWidth("900")}> change width </button>
    </div>
  )
}

export default App;
